import React from 'react'
import MenuIcon from '@material-ui/icons/Menu';
import LiveHelpIcon from '@material-ui/icons/LiveHelp';
import MailIcon from '@material-ui/icons/Mail';
import LibraryBooksIcon from '@material-ui/icons/LibraryBooks';
import {useHistory} from 'react-router-dom'
import './DeskSide.css'

function SideBar() {

    const history = useHistory();

    const CloseNav=()=>{
        document.getElementById("mySidenav").style.width = "600px";

    }

    const OpenNav=()=>{
        document.getElementById("mySidenav").style.width = "250px";

    }

    return (
        <div>
            <div id="mySidenav" className="sidenav">
            <a href="javascript:void(0)" className="closebtn" onClick={CloseNav}>&times;</a>

            <div className="nav">
            <LiveHelpIcon onClick={OpenNav} />
            <p onClick={()=>history.push('')}>Question</p>
            </div>
            <div className="nav">
            <MailIcon onClick={OpenNav}/>
            <p onClick={()=>history.push('')}>FellowMont - Bot</p>
            </div>
            <div className="nav">
            <LibraryBooksIcon onClick={OpenNav}/>
            <p onClick={()=>history.push('')}>Library</p>
            </div>
            </div>

            {/* <div>
            <MenuIcon fontSize="large" style={{fontSize:'30px',cursor:'pointer', marginLeft: '100px'}} onClick={OpenNav} />
            </div> */}
        </div>
    )
}

export default SideBar
